import React, { Component } from 'react';

class Navbar extends Component {

    state = {
        boardName: ""
    }

    render() {
        return (
            <div>
                <nav className="navbar navBar">
                    <div className="d-flex col">
                        <div className="d-flex col-md-6">
                            <i className="fa fa-home rounded mr-2" aria-hidden="true"></i>
                            <input className="searchInp rounded" type="search" placeholder="Search..." />
                        </div>
                        <div className="col-md-4">
                            <h4 className="trello"><i className="fa fa-trello mr-1" aria-hidden="true"></i>Trello</h4>
                        </div>
                        <button className="button rounded ml-auto"><i className="fa fa-plus" aria-hidden="true"></i> Create New Board</button>
                    </div>
                </nav>
            </div>
        );
    }
}

export default Navbar;
